Erwartungsmanagement



Ein Kurs dieses Umfangs muss sich auf die Grundlagen von R und ausgewählte Anwendungsmöglichkeiten beschränken. Deshalb orientieren wir uns maßgeblich an ausgewählten Inhalten des Standardwerks R for Data Science (Wickham, Çetinkaya-Rundel, und Grolemund 2023). Auf das zunehmend unübersichtliche Angebot an Möglichkeiten zum Selbststudium gehen wir später ein.

4.6 Lösungen

4.6.1 Überblick verschaffen

nrow(flights)
ncol(flights)
str(flights)
?flights



4.6.2 Filtering




flights |&gt; 
  filter(dep_delay &gt; 120) |&gt; 
  nrow()





flights |&gt; 
  filter(dest %in% c("IAH", "HOU")) |&gt; 
  nrow()





flights |&gt; 
  filter(carrier %in% c("UA", "AA", "DL")) |&gt; 
  nrow()





flights |&gt; 
  filter(between(month, 7, 9)) |&gt; 
  nrow()





flights |&gt; 
  filter(dep_delay &lt;= 0, arr_delay &gt; 120) |&gt; 
  nrow()





flights |&gt; 
  filter(dep_delay &gt;= 60, arr_delay &lt; 30) |&gt; 
  nrow()



4.6.3 Einmalige Kombinationen

flights |&gt; 
  distinct(year, month, day) |&gt; 
  nrow()



4.6.4 Slicing
Nutzen Sie eine der slice_*-Funktionen, um die folgenden Fragen zu beantworten.




flights |&gt; 
    slice_max(distance, n = 3)





flights |&gt; 
    slice_min(distance, n = 3)





flights |&gt; 
    slice_max(air_time, n = 5)





flights |&gt; 
  slice_min(air_time, n = 5)



4.6.5 Arranging




flights |&gt; 
  arrange(carrier)





flights |&gt; 
  arrange(carrier, desc(arr_delay), desc(dep_delay))





flights |&gt; 
  arrange(desc(month), day)





flights |&gt; 
  arrange(dest, desc(arr_delay))





flights |&gt; 
  arrange(desc(distance / air_time))



4.6.6 Selecting




flights |&gt; 
  select(10)





flights |&gt; 
  select(carrier)





flights |&gt; 
  select(dep_time, sched_dep_time, dep_delay)





flights |&gt; 
  select(year:flight)





flights |&gt; 
  select(starts_with("a"))





flights |&gt; 
  select(ends_with("time"))





flights |&gt; 
  select(contains("rr"))





flights |&gt; 
  select(carrier, flight, tailnum, everything())



4.6.7 Renaming und Relocating




flights |&gt; 
  rename(air_time_min = air_time)





flights |&gt; 
  relocate(carrier, flight, tailnum)





flights |&gt; 
  relocate(dep_delay, .after = dep_time)



4.6.8 Mutating

dep_delay gibt die Differenz zwischen der geplanten (sched_dep_time) und tatsächlichen Abflugszeit (dep_time) an. Weil die Zeitangabe aber im Format HHMM ist, können wir die Berechnung nur teilweise nachvollziehen.



flights |&gt; 
  mutate(speed = distance / air_time)





flights |&gt; 
  mutate(air_time_hours = air_time / 60)



4.6.9 Grouping und Summarizing




flights |&gt; 
  group_by(carrier) |&gt; 
  summarize(mean_arr_delay = mean(arr_delay, na.rm = TRUE))





flights |&gt; 
  group_by(carrier) |&gt; 
  summarize(max_distance = max(distance))





flights |&gt; 
  group_by(carrier) |&gt; 
  summarize(min_distance = min(distance))





flights |&gt; 
  group_by(origin) |&gt; 
  summarize(median_dep_delay = median(dep_delay, na.rm = TRUE))



4.6.10 Längere dplyr-Pipelines
Überlegen Sie, in welcher Reihenfolge Sie die Ihnen bekannten Funktionen kombinieren müssen, um die folgenden Fragen zu beantworten.




flights |&gt; 
  filter(month == 3) |&gt; 
  group_by(carrier) |&gt; 
  summarize(mean_speed = mean(distance / air_time)) |&gt; 
  slice_max(mean_speed, n = 1)





flights |&gt; 
  mutate(delay_gain = arr_delay - dep_delay) |&gt; 
  group_by(carrier) |&gt; 
  summarize(mean_delay_gain = mean(delay_gain, na.rm = TRUE)) |&gt; 
  slice_min(mean_delay_gain, n = 1)





flights |&gt; 
  group_by(month) |&gt; 
  summarize(mean_distance = mean(distance)) |&gt; 
  slice_max(mean_distance, n = 1)





flights |&gt; 
  filter(month == 12) |&gt; 
  count(dest) |&gt; 
  slice_max(n, n = 1)


Welche Route zwischen dem Abflugsflughafen und Zielflughafen vereinigt die meisten Flüge auf sich?


flights |&gt; 
  count(origin, dest) |&gt; 
  slice_max(n, n = 1)



4.6.11 Fortgeschrittenes

Hierbei handelt es sich um eine eigene zu entwickelnde Fragestellung. Eine Lösung kann also nicht angeboten werden.



flights |&gt; 
  group_by(carrier) |&gt; 
  mutate(dep_delay_difference_from_carrier_mean = dep_delay - mean(dep_delay, na.rm = TRUE))





